import { 

} from '../actions/index';


class Banner extends Component {
	constructor(){
		super()

		this.state = {

		}
	}


	render(){

		let categoryLabels

		if(this.props.categories){
			let rows = this.props.categories.rows

			categoryLabels = rows.map(row => {
				return (
					<h3>{row.name}</h3>

				)
			})

		}


		return(
	     	<div style={{position:'relative', display:'flex', alignItems:'center'}}>
	     		<div style={{left:'0', position:'absolute', width:'100%', padding:'60px'}}>

	     			<div style={{padding:'15px'}}>
	     				<h1>Mens wear</h1>
	     			</div>

	     			<div style={{padding:'15px'}}>
		     			{categoryLabels}
	     			</div>

	     		</div>

	     		<img style={{width:'100%'}} src={modal4}/>
	     	</div>
		);
	}
}


function mapStateToProps(state){
	return { 
		categories:state.categories.categories
	};
}

const mapDispatchToProps = (dispatch) => {
	return bindActionCreators({

	}, dispatch);
};


Banner = connect(mapStateToProps, mapDispatchToProps)(Banner);

export default withRouter(Banner);
